import { useEffect, useState } from "react";


const ShowAll =(props)=>
{

    useEffect(()=>{
        axios.get("http://localhost:8000/api/showAll")
        .then()
        .catch()
    })

    return (
        <>
            <h1>THIS IS THE SHOW ALL</h1>
        </>
    )
}

export default ShowAll;
